import React from 'react'
import './About.css'


import {

    Element,

} from "react-scroll";

class Exec extends React.Component {


    render() {
        return (

            <>
                <Element name="about" className="element"></Element>
                <div className='about'>
                    <h1 className='scaled-title'>MEET THE EXEC!</h1>
                    <p>Warwick Labour is run by its executive committee, elected at the Annual General Meeting at the end of term 2 or beginning of term 3. Caucus officers are elected within autonomous caucuses. The current exec as elected in June 2021 is as follows:</p>

                    <section className="main">

                        <ul className="ch-grid">
                            <li>
                                <div className="ch-item">
                                    <div className="ch-info">
                                        <div className="ch-info-front exec-president"></div>
                                        <div className="ch-info-back">
                                            <h2>JAVA</h2>
                                            <p>Java is a widely used cross platforming programming language.</p>
                                            <p>With java, i have been able to explore and develop in a wide range of fields, from backend web development and databases to desktop software and pathfinding algorithms.</p>
                                        </div>
                                    </div>
                                </div>
                            </li>

                        </ul>

                    </section>
                </div>
            </>


        );
    }
}
export default Exec;
